import React from 'react'
import {Link, useNavigate} from "react-router-dom";

function First() {

  
 const Navigate = useNavigate()
  
  return (
    <div>
      
      <lable>Team</lable>
      <input type="text" name="team"/> <br/>
      
      <lable>Date</lable>
      <input type="date" name="dateFirst"/> <br/>

      <button type="button" onClick={() => Navigate('/Second')}>Start</button> <br/>
       <Link to ={'/Third'}> <input type="submit" name="searchsubmit" value="Search"/></Link >

      
    </div>
  )
}

export default First
